import '../App.css';
import Footer from '../Components/Footer';
import BigHeading from '../Components/BigHeading';

function Blogs(){
    let element = <input placeholder='Type'></input>
    return(
        <div>
            <BigHeading NoImage={true} Title="Search" Content={element}/>
        </div>
    );
}

export default Blogs;
